i sejak 1890 di Jerman sebagai perusahaan yang sangat berpengalaman dan mempunyai posisi finansial yang kuat.</p>\n";s:10:"\0*\0options";N;s:7:"\0*\0name";s:23:"description-1container1";s:13:"\0*\0documentId";i:2;s:12:"\0*\0inherited";b:0;}s:23:"description-2container1";O:20:"Document_Tag_Wysiwyg":5:{s:4:"text";s:246:"<p>Allianz merupakan salah satu perusahaan global terbesar yang bergerak di bidang layanan asuransi dan manajemen aset. Telah berdiri sejak 1890 di Jerman sebagai perusahaan yang sangat berpengalaman dan mempunyai posisi finansial yang kuat.</p>\n";s:10:"\0*\0options";N;s:7:"\0*\0name";s:23:"description-2container1";s:13:"\0*\0documentId";i:2;s:12:"\0*\0inherited";b:0;}s:23:"description-3container1";O:20:"Document_Tag_Wysiwyg":5:{s:4:"text";s:220:"<div>\n<p>Visi Allianz Indonesia:</p>\n\n<p>Allianz Indonesia menjadi <strong>PILIHAN PERTAMA, MEREK YANG TERPERCAYA </strong>dalam memenuhi janji-janjinya dengan <strong>PENGALAMAN YANG TAK TERLUPAKAN</strong>.</p>\n</div>\n";s:10:"\0*\0options";N;s:7:"\0*\0name";s:23:"description-3container1";s:13:"\0*\0documentId";i:2;s:12:"\0*\0inherited";b:0;}s:23:"description-4container1";O:20:"Document_Tag_Wysiwyg":5:{s:4:"text";s:217:"<p>Allianz Indonesia bertekad untuk mengembangkan jalur distribusi melalui kerjasama strategis dan terpercaya. Melalui kerjasama ini diharapkan masyarakat luas dapat menikmati produk-produk asuransi dari Allianz.</p>\n";s:10:"\0*\0options";N;s:7:"\0*\0name";s:23:"description-4container1";s:13:"\0*\0documentId";i:2;s:12:"\0*\0inherited";b:0;}s:23:"description-5container1";O:20:"Document_Tag_Wysiwyg":5:{s:4:"text";s:162:"<p>Manfaatkan kesempatan berkarir dan menjadi bagian dari keluarga Allianz untuk mencapai impian Allianz membantu orang lain memiliki hidup aman dan bahagia.</p>\n";s:10:"\0*\0options";N;s:7:"\0*\0name";s:23:"description-5container1";s:13:"\0*\0documentId";i:2;s:12:"\0*\0inherited";b:0;}s:23:"description-6container1";O:20:"Document_Tag_Wysiwyg":5:{s:4:"text";s:0:"";s:10:"\