(2, 'description-1container1', 'wysiwyg', '<p>Allianz merupakan salah satu perusahaan global terbesar yang bergerak di bidang layanan asuransi dan manajemen aset. Telah berdiri sejak 1890 di Jerman sebagai perusahaan yang sangat berpengalaman dan mempunyai posisi finansial yang kuat.</p>\n'),
(2, 'description-2container1', 'wysiwyg', '<p>Allianz merupakan salah satu perusahaan global terbesar yang bergerak di bidang layanan asuransi dan manajemen aset. Telah berdiri sejak 1890 di Jerman sebagai perusahaan yang sangat berpengalaman dan mempunyai posisi finansial yang kuat.</p>\n'),
(2, 'description-3container1', 'wysiwyg', '<div>\n<p>Visi Allianz Indonesia:</p>\n\n<p>Allianz Indonesia menjadi <strong>PILIHAN PERTAMA, MEREK YANG TERPERCAYA </strong>dalam memenuhi janji-janjinya dengan <strong>PENGALAMAN YANG TAK TERLUPAKAN</strong>.</p>\n</div>\n'),
(2, 'description-4container1', 'wysiwyg', '<p>Allianz Indonesia bertekad untuk mengembangkan jalur distribusi melalui kerjasama strategis dan terpercaya. Melalui kerjasama ini diharapkan masyarakat luas dapat menikmati produk-produk asuransi dari Allianz.</p>\n'),
(2, 'description-5container1', 'wysiwyg', '<p>Manfaatkan kesempatan berkarir dan menjadi bagian dari keluarga Allianz untuk mencapai impian Allianz membantu orang lain memiliki hidup aman dan bahagia.</p>\n'),
(2, 'description-6container1', 'wysiwyg', ''),
