INSERT INTO `object_store_6` (`oo_id`, `image`, `description`, `title`, `link`, `category`, `date`) VALUES
(24, 11, '<p>Timbulnya rasa lapar tidak selalu karena tubuh membutuhkan nutrisi atau energi. Ada beberapa faktor yang bisa menyebabkan Anda merasa lapar, padahal asupan energi dan kalori dalam tubuh sudah lebih dari cukup. Ini tujuh faktor yang menyebabkan orang lapar seperti dilansir Womansday, dan kenali mana rasa lapar yang sebenarnya dan mana yang hanya hasrat sesaat.</p>\n\n<p><strong>1. Kurang Tidur di Malam Hari</strong></p>\n\n<p>Kurang istirahat bisa membuat tubuh kehilangan energi dan membingungkan hormon nafsu makan. Akibatnya, tubuh akan merasakan rasa lapar yang berlebihan sehingga hasrat makan di esok harinya jadi menggila. Cukup tidur selama delapan jam setiap malam merupakan cara paling mudah namun penting untuk mencegah konsumsi makanan yang berlebihan.</p>\n\n<p>&quot;Saat tubuh kurang energi, tingkat leptin (hormon yang diproduksi sel lemak untuk mengontrol nafsu makan) juga menurun, sedangkan tingkat gherlin (hormon yang memicu nafsu makan) meningkat,&quot; jelas Karen Ansel, RD, juru bicara American Dietetic Association.</p>\n\n<p><strong>2. Penggunaan Obat-obatan</strong></p>\n\n<p>Jika Anda kelaparan setelah minum obat antibiotik untuk menghilangkan reaksi alergi, peradangan sendi, jerawat atau batuk, mungkin obat tersebut penyebabnya. Obat medis yang mengandung steroid ringan seperti prednisone atau corticosteroid bisa memicu rasa lapar yang berlebihan.</p>\n\n<p>&quot;Jika Anda telah mengonsumsi makanan porsi normal sebelum minum obat, maka rasa lapar yang timbul setelahnya bisa diabaikan,&quot; ujar Milton Stokes, RD, pemilik One Source Nutrition. Untuk mengalihkan rasa lapar, kunyahlah permen karet, seruput secangkir kecil kopi hangat atau gosok gigi.</p>\n\n<p><strong>3. Dehidrasi</strong></p>\n\n<p>Gejala dehidrasi biasanya mirip dengan gejala saat tubuh lapar, yang ditandai dengan rasa ngantuk dan lemas. Hal tersebut bisa membuat anggapan bahwa Anda memerlukan makanan untuk meningkatkan energi. Saat kehausan, mulut menjadi kering dan rasa lapar pun mendera. Sebelum menjejali mulut Anda dengan makanan, saat rasa lapar datang, cobalah untuk minum segelas air putih atau secangkir teh herbal. Tunggu selama 10 menit, jika rasa lapar hilang, berarti yang tubuh Anda butuhkan hanya cairan.</p>\n\n<p><strong>4. Baru Selesai Olahraga</strong></p>\n\n<p>Setelah berolahraga keras seperti latihan spinning atau interval, biasanya rasa lapar akan datang. Tapi itu bukan berarti tubuh Anda memerlukan kalori ekstra. Menurut Marissa Lipper, RD, konsultan nutrisi dan diet di New York City, rasa lapar yang datang merupakan sinyal kalau tubuh Anda membutuhkan nutrisi yang lebih spesifik.</p>\n\n<p><strong>5. Ada Teman yang Makan di Dekat Anda</strong></p>\n\n<p>Studi yang dilakukan Duke University dan Arizona State University menemukan bahwa wanita cenderung mengikuti kebiasaan makan teman atau wanita lainnya. Ketika satu orang makan, maka orang-orang yang bersamanya pun ikut ingin makan. Maka saat teman makan, sementara Anda sudah menghabiskan makanan, segera beranjak dari tempat duduk dan berjalan-jalanlah sebentar. Tahanlah keinginan untuk ikut makan atau mencicipi makanan teman Anda.</p>\n\n<p><strong>6. Melihat atau Menghirup Aroma Makanan</strong></p>\n\n<p>Ketika seseorang melihat makanan, meskipun hanya dari sebuah gambar, iklan atau TV, hasrat makan bisa saja mucul. Hal ini juga bisa terjadi ketika kita mencium harum roti yang dipanggang atau menonton acara memasak. Untuk menghindarinya, segera ganti channel ketika ada iklan tentang produk makanan atau keluar dari ruangan saat acara demo masak berlangsung. Hasrat makan pun bisa segera hilang.</p>\n\n<p><strong>7. Stres</strong></p>\n\n<p>Berhati-hatilah saat sedang stres, karena bisa berakibat tubuh semakin gemuk. Sejumlah studi menunjukkan, saat seseorang stres, dia cenderung ingin makan makanan tinggi lemak, asin dan manis. Hormon cortisol dan insulin menjadi penyebab hasrat makan menggila ketika stres. Jika stres melanda, jangan buru-buru mengambil cup es krim atau mengulum berkeping-keping cokelat. Sesegera mungkin coba jernihkan pikiran dan atasi stres dengan enam cara ini.</p>\n\n<p>Sumber artikel: <a href="http://wolipop.detik.com/read/2013/12/12/133342/2440048/849/7-faktor-yang-membuat-perut-terasa-lapar-meskipun-sudah-makan">http://wolipop.detik.com/read/2013/12/12/133342/2440048/849/7-faktor-yang-membuat-perut-terasa-lapar-meskipun-sudah-makan</a></p>\n', 'Cegah 7 Faktor yang Membuat Perut Terasa Lapar Meskipun Sudah Makan', 'N;', 'Health and Beauty', 1405357200),
