(24, '/community-tips/7-faktor', 'object', 'object', 'communityTips', 1, 1405408948, 1405410650, 2, 2, 'ID: 24  \nPath: /community-tips/7-faktor  \nCegah 7 Faktor yang Membuat Perut Terasa Lapar Meskipun Sudah Makan /tip1.png Timbulnya rasa lapar tidak selalu karena tubuh membutuhkan nutrisi atau energi. Ada beberapa faktor yang bisa menyebabkan Anda merasa lapar, padahal asupan energi dan kalori dalam tubuh sudah lebih dari cukup. Ini tujuh faktor yang menyebabkan orang lapar seperti dilansir Womansday, dan kenali mana rasa lapar yang sebenarnya dan mana yang hanya hasrat sesaat. 1. Kurang Tidur di Malam Hari Kurang istirahat bisa membuat tubuh kehilangan energi dan membingungkan hormon nafsu makan. Akibatnya, tubuh akan merasakan rasa lapar yang berlebihan sehingga hasrat makan di esok harinya jadi menggila. Cukup tidur selama delapan jam setiap malam merupakan cara paling mudah namun penting untuk mencegah konsumsi makanan yang berlebihan. &quot;Saat tubuh kurang energi, tingkat leptin (hormon yang diproduksi sel lemak untuk mengontrol nafsu makan) juga menurun, sedangkan tingkat gherlin (hormon yang memicu nafsu makan) meningkat,&quot; jelas Karen Ansel, RD, juru bicara American Dietetic Association. 2. Penggunaan Obat-obatan Jika Anda kelaparan setelah minum obat antibiotik untuk menghilangkan reaksi alergi, peradangan sendi, jerawat atau batuk, mungkin obat tersebut penyebabnya. Obat medis yang mengandung steroid ringan seperti prednisone atau corticosteroid bisa memicu rasa lapar yang berlebihan. &quot;Jika Anda telah mengonsumsi makanan porsi normal sebelum minum obat, maka rasa lapar yang timbul setelahnya bisa diabaikan,&quot; ujar Milton Stokes, RD, pemilik One Source Nutrition. Untuk mengalihkan rasa lapar, kunyahlah permen karet, seruput secangkir kecil kopi hangat atau gosok gigi. 3. Dehidrasi Gejala dehidrasi biasanya mirip dengan gejala saat tubuh lapar, yang ditandai dengan rasa ngantuk dan lemas. Hal tersebut bisa membuat anggapan bahwa Anda memerlukan makanan untuk meningkatkan energi. Saat kehausan, mulut menjadi kering dan rasa lapar pun mendera. Sebelum menjejali mulut Anda dengan makanan, saat rasa lapar datang, cobalah untuk minum segelas air putih atau secangkir teh herbal. Tunggu selama 10 menit, jika rasa lapar hilang, berarti yang tubuh Anda butuhkan hanya cairan. 4. Baru Selesai Olahraga Setelah berolahraga keras seperti latihan spinning atau interval, biasanya rasa lapar akan datang. Tapi itu bukan berarti tubuh Anda memerlukan kalori ekstra. Menurut Marissa Lipper, RD, konsultan nutrisi dan diet di New York City, rasa lapar yang datang merupakan sinyal kalau tubuh Anda membutuhkan nutrisi yang lebih spesifik. 5. Ada Teman yang Makan di Dekat Anda Studi yang dilakukan Duke University dan Arizona State University menemukan bahwa wanita cenderung mengikuti kebiasaan makan teman atau wanita lainnya. Ketika satu orang makan, maka orang-orang yang bersamanya pun ikut ingin makan. Maka saat teman makan, sementara Anda sudah menghabiskan makanan, segera beranjak dari tempat duduk dan berjalan-jalanlah sebentar. Tahanlah keinginan untuk ikut makan atau mencicipi makanan teman Anda. 6. Melihat atau Menghirup Aroma Makanan Ketika seseorang melihat makanan, meskipun hanya dari sebuah gambar, iklan atau TV, hasrat makan bisa saja mucul. Hal ini juga bisa terjadi ketika kita mencium harum roti yang dipanggang atau menonton acara memasak. Untuk menghindarinya, segera ganti channel ketika ada iklan tentang produk makanan atau keluar dari ruangan saat acara demo masak berlangsung. Hasrat makan pun bisa segera hilang. 7. Stres Berhati-hatilah saat sedang stres, karena bisa berakibat tubuh semakin gemuk. Sejumlah studi menunjukkan, saat seseorang stres, dia cenderung ingin makan makanan tinggi lemak, asin dan manis. Hormon cortisol dan insulin menjadi penyebab hasrat makan menggila ketika stres. Jika stres melanda, jangan buru-buru mengambil cup es krim atau mengulum berkeping-keping cokelat. Sesegera mungkin coba jernihkan pikiran dan atasi stres dengan enam cara ini. Sumber artikel: http://wolipop.detik.com/read/2013/12/12/133342/2440048/849/7-faktor-yang-membuat-perut-terasa-lapar-meskipun-sudah-makan Health and Beauty Jul 15, 2014 12:00:00 AM ', ''),
